import React, {useState} from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from "axios";

function RestaurantLogin() {

  const customerSignup = () => {
    Axios.post("http://localhost:3001/CustomerLogin", {
      name:restaurantName,
      email:email,
      password:restaurantPassword,
      location:restaurantLocation
    }).then (() =>{
      alert("Successfully Inserted");
    })
  }

  const [restaurantName,setrestaurantName]=useState("");
  const [email,setEmail]=useState("");
  const [restaurantPassword,setrestaurantPassword]=useState("");
  const [restaurantLocation,setrestaurantLocation]=useState("");

  return (
    <div>
    <h1 className="customer-heading">Uber <span className="heading-eats">Eats</span></h1>
    <h1 className="form-floating">Restaurant SignUp</h1>
    <div class="form-floating">
     <input type="text" class="form-control" id="floatingName" placeholder="John Doe" name="restaurantName" onChange={(e) =>{
       setrestaurantName(e.target.value);
     }} />
     <label for="floatingName">Restaurant Name</label>
    </div>
    <div class="form-floating mb-3">
     <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com" name="email" onChange={(e) => {
       setEmail(e.target.value);
     }} />
     <label for="floatingInput">Email address</label>
    </div>
    <div class="form-floating">
     <input type="password" class="form-control" id="floatingPassword" placeholder="Password" name="restaurantPassword" onChange={(e) =>{
       setrestaurantPassword(e.target.value);
     }} />
     <label for="floatingPassword">Password</label>
     </div>
     <div class="form-floating">
      <input type="text" class="form-control" id="floatingPassword" placeholder="location" name="restaurantLocation" onChange={(e) =>{
        setrestaurantLocation(e.target.value);
      }} />
      <label for="floatingPassword">Password</label>
      </div>
     <div class="d-grid gap-10">
     <button onClick={restaurantSignup} type="button" class="btn btn-primary">Submit</button>
     </div>
     </div>
   );

}

export default RestaurantLogin;
